DROP TABLE IF EXISTS city_stations;
CREATE TABLE city_stations(
   INDIC_UR                  VARCHAR(71) NOT NULL
  ,V2018                     INTEGER  NOT NULL
  ,V2019                     INTEGER  NOT NULL
  ,V2020                     INTEGER  NOT NULL
  ,slug                      VARCHAR(23) NOT NULL
  ,id                        INTEGER  NOT NULL
  ,uic                       VARCHAR(7) NOT NULL
  ,latitude                  VARCHAR(17) NOT NULL
  ,longitude                 VARCHAR(19) NOT NULL
  ,parent_station_id         VARCHAR(5) NOT NULL
  ,country                   VARCHAR(2) NOT NULL
  ,time_zone                 VARCHAR(17) NOT NULL
  ,is_city                   BOOLEAN  NOT NULL
  ,is_main_station           BOOLEAN  NOT NULL
  ,is_airport                BOOLEAN  NOT NULL
  ,is_suggestable            BOOLEAN  NOT NULL
  ,flixbus_is_enabled        BOOLEAN  NOT NULL
  ,sncf_self_service_machine VARCHAR(5) NOT NULL
  ,normalised_code           VARCHAR(34) NOT NULL
  ,iata_airport_code         VARCHAR(2) NOT NULL
  ,cityName                  VARCHAR(23) NOT NULL
  ,PRIMARY KEY(INDIC_UR,cityName)
);
